"use strict";var express=require("express"),MoreInfo=require("./moreInfo-model"),router=express.Router();router.get("/:id/moreinfo",function(e,o){var r=e.params.id;MoreInfo.findMoreInfoById(r).then(function(e){e.length?o.json(e):o.status(404).json({message:"Could not find project for given project"})}).catch(function(e){o.status(500).json({message:"Failed to get project"})})}),module.exports=router;